INSERT INTO `base_conhecimento` (`id`, `id_plataforma`, `pergunta`, `resposta`, `anexo`, `data_pub`) VALUES
(14, 3, 'Rejeição 604: Total do vOutro difere do somatório dos itens - Como resolver?', 'Deve-se verificar e refazer o somatório dos campos vOutro de todos os itens e corrigir o Valor do campo vOutro informado nos Totais da NF-e.\nHá uma tolerância para mais ou para menos de R$ 0,01 de diferença do valor calculado sem aproximações.\nApós ter corrigido o Valor Total do campo vOutro, basta reenviar a NF-e para processamento.\nÉ recomendável entrar em contato com o suporte do Sistema ERP para que corrigia os cálculos realizados, caso esses sejam feitos automaticamente.', '68b08b14b286f8b338dfca82db7ab243', '2017-07-14 10:42:00'),
(15, 3, 'Rejeição 676: NF-e informada com diferença de chave de acesso - Como resolver?', 'Deve-se informar a Chave de Acesso da NF-e conforme a existente na Sefaz. Recomendamos entrar em contato com o emitente da NF-e para que essa Chave de Acesso, correta, seja informada.\nFeita a correção, basta reenviar o MDF-e a partir do seu Software Emissor.', '481a3ef7cecfb16f2f28367e2727fd00', '2017-07-14 10:42:00'),
(16, 3, 'Rejeição 616: Nenhum grupo de documentos foi informado (CT-e, CT, NF-e, NF, MDF-e) - Como resolver?', 'Deve-se informar pelo menos um Grupo de Documento (CT-e, NF-e ou MDF-e). Se preciso, entre em contato com o suporte do seu ERP para receber orientações de como preencher essa informação ou até mesmo se não há uma falha no ERP preencher esses dados. Veja a seguir exemplo de XML com um Grupo de Documentos\nInformado o Grupo de Documentos (CT-e, NF-e ou MDF-e), basta reenviar o documento para processamento.', '03789368e483b9768e9908a686efa685', '2017-07-14 10:42:00'),
(17, 1, 'Nota de entrada no Genus ERP', '\r\ncliente precisa emitir nota com cfop 2202 - entrada do cliente\r\ndai no genus nao ta aceitando\r\ncomo deve ser feito nesse caso ? ele so aceita emitir com cfops iniciando com 5 ou 6\r\ncomo fazer quando cliente precisar emitir nota com cfop de entrada ?\r\n\r\nR: ref. A NF Ele lanÃ§a uma NF de entrada e marca a opÃ§Ã£o NFprÃ³pria. neste caso aparece no gerador. \r\n\r\n', 'f35e51ec15d415965b443ac9a11e316b', '2017-07-14 10:42:00'),
(19, 3, 'Rejeição 531: Total da BC ICMS difere do somatório dos itens - Como resolver?', 'Utilizando o mesmo exemplo dado, vamos realizar o cálculo:\n\nvBC [Total] = vBC [item 1] + vBC [item 2]\n\nvBC [Total] = 199.99 + 199.99\n\nvBC [Total] = 399.98\n\nO mesmo cálculo é válido para qualquer quantidade de itens que haja na NF-e / NFC-e. Feito o cálculo, corrija nos Totais da NF-e o campo correspondente ao somatório da Base de Cálculo do ICMS. Agora basta fazer o envio da NF-e novamente.', '77a834374ea77079f09fd02d58c0505f', '2017-07-14 10:42:00'),
(20, 3, 'Liberar permissao Terminal Server para usuarios', 'Abrimos o "Group Policy Managemente" e editar a GPO "Default Domain Policy".\r\n\r\ncomputer configuration > policies > Windows settings > security settings > local policy > user rights assignment > "permitir logar atravÃ©s do serviÃ§o de terminal services".\r\n\r\nAdicionamos os grupos ou usuÃ¡rios para liberar a conexÃ£o via TS', 'f3d74adcf91440fff7be54feedcfa4ac.png', '2017-07-14 10:42:00'),
(22, 3, 'Rejeição 563: Já existe pedido de Inutilização com a mesma faixa de inutilização - Como resolver?', 'Deve-se aguardar que a Sefaz retorne a situação do processamento do primeiro envio da Inutilização. Se passado muito tempo e a Sefaz não retornar a situação do registro, é necessário acionar a mesma para verificação.', 'dd8ecbcf1f541b1f51f3a3f31fa1be40', '2017-07-14 14:51:00'),
(23, 3, 'Rejeição 284: Certificado Transmissor revogado - Como resolver?', 'Deve-se verificar o motivo pelo qual o Certificado Transmissor foi revogado e substituí-lo por um válido / ativo. Feita a substituição pode-se realizar o reenvio da NF-e para que seja autorizada.', NULL, '2017-07-17 16:19:00'),
(24, 3, 'A Autoridade de certificação não é valida ou esta incorreta - O que fazer? ', 'Deve-se verificar se a cadeia de certificados da certificadora está instalado e (ou) atualizada.\r\nSe não pode ser baixada a cadeia de todas as certificadoras através do link \r\n\r\nhttp://acraiz.icpbrasil.gov.br/repositorio/v1_v2_v3_v5_msie.p7b\r\n\r\nAgora basta testar novamente.', NULL, '2017-07-18 17:21:00'),
(25, 3, 'Rejeição 728: NF-e sem informação da IE do destinatário - Como resolver?', 'Todo Destinatário identificado como Contribuinte de ICMS (indIEDest = 1) na emissão de uma NF-e, deve, obrigatoriamente ter sua Inscrição Estadual informada. Para corrigir essa rejeição, verifique se o Destinatário é Contribuinte de ICMS, se for, você deverá informar sua Inscrição Estadual.', NULL, '2017-07-18 17:32:00');
