(1753, 110, 2, 'at sisauto-erro entrada notas', '2017-12-26', '2017-12-26', 'enviar novo sisauto.exe que mandei por email pra welisson - apos atualizar dar entrada em 3 xmls que estao na pasta downloads deles - fornecedor romanha(2) e paraf(1)     entrarao como efd 788,789 790 -  se preciso for deletar as efds ja feitas e dar entrada de novo - estava dando erro ao escolher como unidade na hora da entrada, dai apos o erro a nota fica com a entrada pela metade dos produtos. com o novo exe dara pra fazer a entrada correta dai.  Ligar pra ela pra atualizar dai', '', '2', '00:00:00', '3001664d2be04108c516ac92f9eda269'),
(1754, 21, 2, 'atualizacao sisauto', '2018-01-09', '2018-01-09', 'ficou de atualizar sisauto pra ela um dia cedo - irao ligar pra pedir - dia 26 ou 27 -  atualizei em 2 remotos deles pra ela usar a rotina do cartao - mas deu erro ao gravar produto na tela de cad de produto -  (erro de rodar bdupdate2)  -  entao teria que rodar um bdupdate2 completo pra ver se ja resolve com o novo executavel que te enviei por email - se nao resolver (ver com ela pra manter o executavel antigo e o novo talvez no micro do cartao, so pra ela poder usar) mas acho que o bdupdate2 ja resolvera - dai ela fica com o exe novo ja ', '', '2', '00:15:00', 'a3a4cf28d99e29d01964d2f5a42b51c6'),
